import React, { Component } from "react";
import Counter from "./components/hello";

class Counters extends Component {

  state = {
    tags: [
      { id: 1, count: 5 },
      { id: 2, count: 1 },
      { id: 3, count: 0 }
    ]
  };

  render() {
    return (
      <div>
        {this.state.tags.map(tag => <Counter key={tag.id} value={tag.count} />)}
      </div>
    );
  }

}

export default Counters;
